import React from 'react'
import { Switch, Route } from 'react-router-dom'

import Button from './Button'
import ButtonLink from './ButtonLink'


const App = (props) => {
  const handleClick = e => {
    e.preventDefault()
    // Do something
  }

  return (
    <div>
      <Button onClick={handleClick}>Do the Thing!</Button>
    <ButtonLink route={'/somewhere'}>Go the Places!</ButtonLink>
    <div>
      <Switch>
        <Route path='/somewhere' render={() => <h2>You Are Somewhere</h2>} />
        <Route path='/' render={() => <h2>You Are Nowhere</h2>} />
      </Switch>
    </div>
    </div>

  )
}

export default App
